start transaction;

use `ga_stocks`;

DROP TABLE symbol_metadata;
DROP TABLE industry;
DROP TABLE sector;

CREATE TABLE `sector` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `description` varchar(100) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `description_UNIQUE` (`description`),
  UNIQUE KEY `id_UNIQUE` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE `industry` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `description` varchar(100) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `description_UNIQUE` (`description`),
  UNIQUE KEY `IDX_id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE `symbol_metadata` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `symbol_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `sector_id` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL,
  `industry_id` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL,
  `ipo_year` integer COLLATE utf8mb4_bin DEFAULT 0,
  `market_cap` double(9,3) COLLATE utf8mb4_bin DEFAULT 0.0,
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_SymbolId_Sector_Id_Industry_Id` (`symbol_id`,`sector_id`,`industry_id`),
  KEY `FK_SymbolMetadata_Symbol` (`symbol_id`),
  KEY `FK_SymbolMetadata_Sector` (`sector_id`),
  KEY `FK_SymbolMetadata_Industry` (`industry_id`),
  CONSTRAINT `FK_SymbolMetadata_Symbol` FOREIGN KEY (`symbol_id`) REFERENCES `symbol` (`id`)
  -- CONSTRAINT `FK_SymbolMetadata_Sector` FOREIGN KEY (`sector_id`) REFERENCES `sector` (`id`),
  -- CONSTRAINT `FK_SymbolMetadata_Industry` FOREIGN KEY (`industry_id`) REFERENCES `industry` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;






CREATE TABLE `company` (
  `id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `symbol_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `industry_id` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL,
  `sectory_id` varchar(36) COLLATE utf8mb4_bin DEFAULT NULL,
  `exchange_market_id` varchar(36) COLLATE utf8mb4_bin NOT NULL,
  `name` varchar(500) COLLATE utf8mb4_bin NOT NULL DEFAULT '',
  `legal_name` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL,
  `legal_entity_identifier` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `employee_count` int(11) DEFAULT NULL,
  `short_description` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL,
  `long_description` varchar(5000) COLLATE utf8mb4_bin DEFAULT NULL,
  `ceo` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `company_url` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL,
  `businses_address` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL,
  `mailing_address` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL,
  `business_phone_number` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `headquarter_address_line_1` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `headquarter_address_line_2` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `headquarter_address_city` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `headquarter_address_postal_code` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `headquarter_state` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `incorporated_state` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `incorporated_country` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `entity_legal_form` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `cik` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `sic` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `latest_filing_date` date DEFAULT NULL,
  `entity_status` tinyint(1) DEFAULT '0',
  `standardized_active` tinyint(1) DEFAULT '0',
  `template` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `json_dump` text COLLATE utf8mb4_bin,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  KEY `IDX_Symbol` (`symbol_id`),
  KEY `IDX_Industry` (`industry_id`),
  KEY `IDX_Sector` (`sectory_id`),
  KEY `IDX_ExchangeMarket` (`exchange_market_id`),
  CONSTRAINT `FK_Company_ExchangeMarket` FOREIGN KEY (`exchange_market_id`) REFERENCES `exchange_market` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_Company_Industry` FOREIGN KEY (`industry_id`) REFERENCES `industry` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_Company_Sector` FOREIGN KEY (`sectory_id`) REFERENCES `sector` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_Company_Symbol` FOREIGN KEY (`symbol_id`) REFERENCES `symbol` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


commit;
